import {
	ButtonWrapper,
	FeatureGrid,
	FeatureHeading,
	FeatureImage,
	FeatureParagraph,
} from "./styles";

import Button from "../Button";
import Grid from "../Grid";
import Section from "../Section";

const Feature = ({ inverted, children }) => {
	return (
		<Section>
			<FeatureGrid inverted={inverted}>{children}</FeatureGrid>
		</Section>
	);
};

Feature.Title = ({ children }) => <FeatureHeading>{children}</FeatureHeading>;
Feature.Image = (props) => <FeatureImage {...props} />;
Feature.Description = ({ children }) => (
	<FeatureParagraph>{children}</FeatureParagraph>
);
Feature.Button = ({ children, ...props }) => (
	<ButtonWrapper>
		<Button {...props}>{children}</Button>
	</ButtonWrapper>
);

export default Feature;
